pragma solidity ^0.4.24;
// import "../SharedContracts/VuupleAdmins.sol";

contract RenterFiles {
    enum BzzSchemas { RESOURCE,IMMUTABLE,HASH,LISTt ,RAW}
        // VuupleAdmins private vuupleAdmin;

    struct File{
        //string BZZHash;
        uint size;
        string fileType;
        BzzSchemas bzzSchema;
        bool isDeleted;
        bool isEncrypted;
        string encryptedKey;
    }
    address public fileOwner;
    address public parentContract;
    // bool public burn=false;
    mapping (string=>File) BzzHashToFileDetails;
    mapping (string=>string) fileNameToBzzHash;
    // string[]BZZHash;
    // uint index;

    modifier onlyParentContract(){
        require(msg.sender==parentContract, "only parentContract can call this function");
        _;
    }
    constructor(address _fileOwner){
        fileOwner = _fileOwner;
        parentContract=msg.sender;
    }
    // modifier isBurnt{
    //          require(!burn);
    //                _;}
function addFile(
        string _bzzHash,
        string _fileName,
        uint _size,
        string _fileType,
        uint _bzzSchema,
        bool _isEncrypted,
        string _encryptedKey) onlyParentContract returns (bool) {

          fileNameToBzzHash[_fileName]= _bzzHash; 

          File memory newFile ;
          if(uint(BzzSchemas.RESOURCE)==_bzzSchema){
             newFile.bzzSchema=BzzSchemas.RESOURCE;
          }
          else if(uint(BzzSchemas.IMMUTABLE)==_bzzSchema){
             newFile.bzzSchema=BzzSchemas.IMMUTABLE;
          }
          else if(uint(BzzSchemas.HASH)==_bzzSchema){
             newFile.bzzSchema=BzzSchemas.HASH;
          }
         else if(uint(BzzSchemas.LISTt)==_bzzSchema){
             newFile.bzzSchema=BzzSchemas.LISTt;
          }
         else if(uint(BzzSchemas.RAW)==_bzzSchema){
             newFile.bzzSchema=BzzSchemas.RAW;
          }else{
              revert();
          }
          newFile.size=_size;
        newFile.fileType=_fileType;

        newFile.isDeleted=false;
        newFile.isEncrypted=_isEncrypted;
        newFile.encryptedKey=_encryptedKey;
          BzzHashToFileDetails[_bzzHash]= newFile; 
          return true;

}
function getFileByName(string name) view returns(   string _bzzHash,
        uint _size,
        string _fileType,
        uint _bzzSchema,
        bool _isEncrypted,
        string _encryptedKey){
  string memory bzzHash =   getFileHashByName(name);
  return (bzzHash,
  BzzHashToFileDetails[bzzHash].size,
  BzzHashToFileDetails[bzzHash].fileType,
 uint( BzzHashToFileDetails[bzzHash].bzzSchema),
  BzzHashToFileDetails[bzzHash].isEncrypted,
  BzzHashToFileDetails[bzzHash].encryptedKey



  );
}

function getFileByHash(string bzzHash) view returns( 
        uint _size,
        string _fileType,
        uint _bzzSchema,
        bool _isEncrypted,
        string _encryptedKey) {
  return (
  BzzHashToFileDetails[bzzHash].size,
  BzzHashToFileDetails[bzzHash].fileType,
  uint(BzzHashToFileDetails[bzzHash].bzzSchema),
  BzzHashToFileDetails[bzzHash].isEncrypted,
  BzzHashToFileDetails[bzzHash].encryptedKey



  );
}

function getFileHashByName(string name) view returns (string) {
    return fileNameToBzzHash[name];
}
function destroy() external {
    require(msg.sender==parentContract  );
    selfdestruct(0);
}
}
